0 00:00:00'),(37,6,0,0,'Disgrace of Redemption',250,'Synesis Absorption/Mike Smith/Milos/Steve Digiorgio',0,0,NULL,'Synesis_Absorption__131222272.mp3','','Synesis Absorption,Mike,Smith,dedrep,msm,Milos,Steve digiorgio,death,metal,deathmetal,serbian,disdained metal,metal,rock,speedmetal,speed,ny,florida,','','\r\nSYNESIS ABSORPTION  began as a Serbian based one-man Death Metal project created in 2009 by Milos Batocanin formerly of the band (Disdained). In 2011 Milos put together a  full line-up consisting of some of Death metal&#039;s most respected talents.\r\nMembers are\r\nBranislav Panic (Bane) - Vocals\r\nMilos Batocanin (Disdained) - Guitars/Vocals\r\nSteve DiGiorgio (Sadus) - Bass\r\nMichael Smith (Suffocation) - Drums\r\n This band delivers a mixture of Brutal/Technical Death Metal, a  touch of Modern Math Metal along with Experimental/Ambient passages. SYNESIS ABSORPTION is currently working on new material for their debut full length release. That will surely grab the attention of the most seasoned Death Metal listeners.\r\n',2810,0,0,0,'1312343455.jpg',1,1,'2011-08-01 23:49:11','0000-00-00 00:00:00','2011-08-25 22:25:14'),(38,6,0,0,'SLAVE 3.0',85,'GRIMM REAL/CCJ/MSM/DEDREP',0,0,NULL,'SLAVE_3.0_131233433.mp3','','Grimm,Real,dedrep,msm,suffocation,mike,smith,mike smith, cha cha jewels,blast beat,rap,Ny hip hop,Ny,death','','',595,0,0,0,'1313437871.jpg',1,0,'2011-08-03 06:49:37','0000-00-00 00:00:00','2011-08-15 13:51:11'),(39,19,0,0,'Girl Feet',394,'Tareq main vocals. Diddi on background vocals.',0,0,NULL,'GirlFeet-5w_131255038.mp3','','','','GIRLFEET: Where witchy women run wild, the glimpses of her are brief, but long enough to keep him stalking her in his head. she knows she&#039;s being watched, and wouldn&#039;t have it any other way. What she&#039;s put on him he can shake, but instead he wears it like a cloak, her animal essence.',2537,0,0,0,'1314598436.jpg',1,1,'2011-08-05 18:50:37','0000-00-00 00:00:00','2011-08-29 00:13:56'),(40,6,0,0,'BLOOD OATH',