/*Table structure for table `songs_copy` */

DROP TABLE IF EXISTS `songs_copy`;

CREATE TABLE `songs_copy` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `weight` int(1) NOT NULL,
  `user_song_id` int(11) NOT NULL,
  `song_name` varchar(255) NOT NULL,
  `song_length` int(10) NOT NULL,
  `song_credit` varchar(500) NOT NULL,
  `song_start_time` float NOT NULL COMMENT 'time in seconds',
  `song_duration` float NOT NULL COMMENT 'duration in seconds',
  `credits` mediumtext,
  `file_path` varchar(255) NOT NULL,
  `video_url` varchar(2048) NOT NULL,
  `metadata` varchar(500) NOT NULL,
  `reject_reason` varchar(500) NOT NULL,
  `admin_review` text NOT NULL,
  `hits` int(11) NOT NULL,
  `download_count` int(11) NOT NULL,
  `is_download` int(1) NOT NULL,
  `for_sell` int(1) NOT NULL,
  `billboard_image` varchar(255) NOT NULL,
  `random` int(1) NOT NULL,
  `status` int(1) NOT NULL,
  `create_date` datetime NOT NULL,
  `publish_date` datetime NOT NULL,
  `modify_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=495 DEFAULT CHARSET=utf8;

