race of Redemption',0,'Synesis Absorption/Mike Smith/Milos/Steve Digiorgio',0,0,NULL,'Synesis_Absorption__131222272.mp3','','Synesis Absorption,Mike,Smith,dedrep,msm,Milos,Steve digiorgio,death,metal,deathmetal,serbian,disdained metal,metal,rock,speedmetal,speed,ny,florida,','','\r\nSYNESIS ABSORPTION  began as a Serbian based one-man Death Metal project created in 2009 by Milos Batocanin formerly of the band (Disdained). In 2011 Milos put together a  full line-up consisting of some of Death metal&#039;s most respected talents.\r\nMembers are\r\nBranislav Panic (Bane) - Vocals\r\nMilos Batocanin (Disdained) - Guitars/Vocals\r\nSteve DiGiorgio (Sadus) - Bass\r\nMichael Smith (Suffocation) - Drums\r\n This band delivers a mixture of Brutal/Technical Death Metal, a  touch of Modern Math Metal along with Experimental/Ambient passages. SYNESIS ABSORPTION is currently working on new material for their debut full length release. That will surely grab the attention of the most seasoned Death Metal listeners.\r\n',2809,0,0,0,'1312343455.jpg',1,1,'2011-08-01 23:49:11','0000-00-00 00:00:00','2011-08-25 22:25:14'),(38,6,0,0,'SLAVE 3.0',0,'GRIMM REAL/CCJ/MSM/DEDREP',0,0,NULL,'SLAVE_3.0_131233433.mp3','','Grimm,Real,dedrep,msm,suffocation,mike,smith,mike smith, cha cha jewels,blast beat,rap,Ny hip hop,Ny,death','','',595,0,0,0,'1313437871.jpg',1,0,'2011-08-03 06:49:37','0000-00-00 00:00:00','2011-08-15 13:51:11'),(39,19,0,0,'Girl Feet',0,'Tareq main vocals. Diddi on background vocals.',0,0,NULL,'GirlFeet-5w_131255038.mp3','','','','GIRLFEET: Where witchy women run wild, the glimpses of her are brief, but long enough to keep him stalking her in his head. she knows she&#039;s being watched, and wouldn&#039;t have it any other way. What she&#039;s put on him he can shake, but instead he wears it like a cloak, her animal essence.',2537,0,0,0,'1314598436.jpg',1,1,'2011-08-05 18:50:37','0000-00-00 00:00:00','2011-08-29 00:13:56'),(40,6,0,0,'BLOOD OATH',0,'MSM/SUFFOCATION',0,0,NULL,'BLOOD_OATH_131256393.mp3','','msm,mike,smith,suffocation,dedrep,grimm,grimmreal,death metal,speed metal,ny metal,ny,blood,blast,blastbeat,slam,hard,terror rap','','',2487,0,0,0,'1312567605.jpg',1,1,'2011-08-05 22:35:47','0000-00-00 00:00:00','2011-08-19 11:57:01'),(41,19,0,0,'Mildew',0,'',0,0,NULL,'Mildew_131256912.mp3','','','','My three year old can&#039;t control himself when he passes a puddle; he has to jump in it, kinda like this track. Is that muddy water? A pool of goo? Whatever it is, I&#039;m going swimming. And after I dunk my head and view the underwater anemones, run my toes through the iridescent coral and blow muck bubbles, I&#039;ll emerge, and wonder if this mildew will leave a permanent stain on my skin. But I won&#039;t care either way. Funky like aged cheese, it&#039;s the right kind of rot.',2476,1,0,0,'1312569183.jpg',1,1,'2011-08-06 00:02:21','0000-00-00 00:00:00','2012-04-16 12:52:03'),(42,19,0,0,'HardBody',0,'',0,0,NULL,'hardbaby_131264421.mp3','','cha cha jewels, moreno brown, hiphop, crossover, mixed genres','','Moreno is a drummer/vocalist. Fearlessly raw, his passion is always on display, and most definitely in his music.\r\n',2459,0,0,0,'1312644312.jpg',1,1,'2011-08-06 20:53:50','0000-00-00 00:00:00','2011-08-29 01:07:04'),(43,19,0,0,'test',0,'',0,0,NULL,'DoubleDown.wav.ff_131316420.mp3','','','','',1,0,0,0,'',1,0,'2011-08-12 09:50:44','0000-00-00 00:00:00','2011-08-12 09:55:42'),(44,19,0,0,'SLAVE46',0,'',0,0,NULL,'slave461.wav.ff_131316914.mp3','','DRDC, MSM, CHA-CHA JEWELS','','',91,1,0,0,'1313169234.jpg',1,0,'2011-08-12 11:12:57','0000-00-00 00:00:00','2012-04-16 12:56:53'),(53,3,0,0,'Hold On',0,'',0,0,NULL,'Hold_On_131350331.mp3','','','','',5881,1,1,0,'',1,1,'2011-08-16 08:02:45','0000-00-00 00:00:00','2011-12-06 01:45:38'),(45,19,0,0,'1WURL',0,'',0,0,NULL,'1WURL-2_131318041.mp3','','Tareq, 1wurl, cha-cha jewels','','1Wurl: In a lavendar-tinged, smoke-filled joint, a wandering supernova and an amorphous wonderboy unite. The 1 Wurl the