anta, so the name for obvious reasons, had to be changed&quot;. After a while, the lyrical and musical chemistry between Christopher and Darrell was so strong and obvious, the third member simply dropped out. Thus the name, eMeiNesS (an acronym for Music&#039;s New Savages) was born. eMeiNesS captures the spirit, enthusiasm, and true brotherhood of rap duos of the past. Groups like Outkast, PM Dawn, EPMD, Method Man',NULL,NULL,NULL,'Review coming soon!','United States','1987-07-23','Brooklyn, NY','@datboidna','facebook.com/darrelljohnson','','','',1,1,1,0,0,'0000-00-00 00:00:00','2011-10-08 07:05:54',NULL,NULL,0),(109,'listener','Cayla Hache','chache','caylahache@gmail.com','e86931c9ec9067c0af41007873502d87','I simply love music and I am always eager to hear what&#039;s new.',NULL,NULL,NULL,'','Canada','1978-10-23','','','','','','',0,0,1,0,0,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,NULL,0),(111,'listener','ian williams','diggydimemusic  i-spy','ispy212@gmail.com','d5cda508e7a51427ab23e538cd6e00dc','v.p of diggydimemusic',NULL,NULL,NULL,'Review coming soon!','United States','1973-12-03','','diggydimemusic','ian williams','','','',1,1,1,0,0,'0000-00-00 00:00:00','2011-10-08 09:57:18',NULL,NULL,0),(112,'listener','ToniiClipse','ToniiClipse','chacon@helen-marie.com','142a89cbf6f50529ffef82942c1a8368','music lover',NULL,NULL,NULL,'','Albania','1902-02-01','','','','','','',0,0,1,0,0,'0000-00-00 00:00:00','0000-00-00 00:00:00',NULL,NULL,0),(113,'musician','Ian Dill','Dillweed','idill211@gmail.com','db683ebb72bdc5ba8950b72a9057de5e','.',NULL,NULL,NULL,'Coming soon!','United States','1991-03-17','','','','','','',1,1,1,0,1,'0000-00-00 00:00:00','2011-10-08 09:55:13',NULL,NULL,0),(114,'musician','GRIMREAL','GRIMREAL','dedrep1@gmail.com','f7930f53a52b70c561713141e2f8eb39','test',NULL,NULL,NULL,'edrfghjk','Afghanistan','1900-01-01','','','','','','',0,0,0,0,1,'0000-00-00 00:00:00','2011-10-05 06:39:16',NULL,NULL,0),(115,'musician','nathaniel forschner','lil nate','ada