 some popular music, the band incorporate some of these influences in the writing process. In January 2011, the band began recording at Solemn Vow Studio in Evansville, Indiana; a studio built by Ryan.\r\n\r\nSome time in May they finished up recording and began the arduous task of mixing and mastering with Kaven and Ryan at the helm. Mid August 2011 the album was completed. The album &ldquo;Vestri Animus est Mei&rdquo; was released to the general public on August 21, 2011.The band is currently working on their next album and playing select shows to promote the current album.','United States','1968-06-27','','http://twitter.com/crucifuge','https://www.facebook.com/pages/Crucifuge/113641185349023','avatar_1318709000.jpg','','',0,0,1,0,1,'0000-00-00 00:00:00','2011-10-15 15:24:59',NULL,NULL,0),(188,'listener','Christopher','Buzzard','chrisfardoux@yahoo.com','44f6f6c118c0543302c11ee175f280ba','Metalhead.',NULL,NULL,NULL,'Death metal,black,metal','United States','1958-10-04','Death metal, black metal','','chrisfardoux@yahoo.com','','','',0,0,1,0,0,'0000-00-00 00:00:00','2011-10-15 17:59:20',NULL,NULL,0),(189,'musician','Death Inquisition','Death_Inquisition','vomitouswarfare@yahoo.com','30ed1eed91713247bd392151e2f8ac2f','Death Inquisition plays thrash metal, mainly influenced by old school bay area thrash and german thrash. We try to push our music with every song. We&#039;re newer around the Tulsa scene and hope to keep moving strong.',NULL,NULL,NULL,'Death Inquisition plays thrash metal, mainly influenced by old school bay area thrash and german thrash. We try to push our music with every song. We&#039;re newer around the Tulsa scene and hope to keep moving strong.','United States','1991-12-26','Thrash metal','','www.facebook.com/DeathInquisition','','','',0,0,1,0,1,'0000-00-00 00:00:00','2011-10-16 12:01:55',NULL,NULL,0),(190,'musician','John Walker Oden','IFUKDR2D2','inverted_prod@hotmail.com','4774beea07e8a6e7623fb5658115dd5a','anyone that loves aggressive technica