lyrical and melodic genius to \r\nthe world; foretelling the turn of this generations appreciation of raw music \r\nand solid performances. Reigning from their infamous hometown of Tampa, Florida, \r\nForeshadow uses their vocal and instrumental influences to comment heavily upon \r\nthe lies that have enveloped as truth amongst the general population; \r\nspecifically regarding the limitations that humanity has placed upon itself, \r\nunder the surfaces of religion, politics, and various means of propaganda. \r\nInfluenced by such mainstream artists who include Slayer, Metallica, Mudvayne, \r\nand Pantera, Foreshadow has already begun the framework and lyrical landscaping \r\nfor their debut, studio LP, &quot;Nations of Failure&quot;. The album will be released to \r\nfans and fellow listeners by Blast Zone Entertainment, and will deliver the \r\ngroup&#039;s ideas and collective beliefs that are saturated in a sense of self \r\nempowerment and individuality. Recorded at Dow Studios in Seffner, Florida, \r\nForeshadows debut album spawns an underlying homage to Ozzy Osbourne, Metallica, \r\nand the bassist for Primus Les Claypool; all of whom have served as inspiration \r\nfor various members of the band. Band members, Corkscrew (vocalist), Aaron \r\nRobinson (guitarist), Richard Hudson (drummer), and Perry Bassin (bassist), \r\nhave been united under Foreshadow umbrella since January of 2008. Individually \r\nand collectively, alike, the band in extremely familiar to stage performance. \r\nHaving opened for international death metal band, Dying Fetus, at The Brass Mug, \r\nas well as playing Fall Fest in Miami, Florida. Foreshadow is geared to begin \r\nproduction on a video compilation for their first, album single, Problem, \r\nReaction, Solution. The success of Foreshadow, presently and in the future of \r\nthe mainstream industry, stems from their ability to avoid the pressures and \r\nstandards of metal music to dictate their visions and creative high. Ultimately, \r\nthe group wishes to inform, motivate, and enlighten the mind set of their fans \r\nand fellow listeners through collaboration of a cross country tour, which shall \r\npromote the unyielding possibilities that their debut album shall present to \r\nthem as a band, and to individuals of the world.',NULL,NULL,NULL,'Foreshadow, a musical group that blends the core genres of death metal, black metal, old school thrash metal, and a minute level of metal core, to create their own, unique sound.','United States','1976-09-18','Metal Music','','http://www.facebook.com/foreshadow76','','','',1,1,1,0,1,'0000-00-00 00:00:00','2011-10-18 13:16:55',NULL,NULL,0),(205,'musician','IGZORDIUM','IGZORDIUM','Igzordium@yahoo.com','3242d5b7d727516c6946a00de6dfd1c2','Metal,Death Metal, Thrash Metal, Black Metal, Melodic Death Metal.',NULL,NULL,NULL,'Metal,Death Metal, Thrash Metal, Black Metal, Melodic Death Metal.','United States','1984-05-27','METAL','@IGZORDIUM','http://www.youtube.com/watch?v=-A3viCGbauc','avatar_1319006866.jpg','','',1,1,1,0,1,'0000-00-00 00:00:00','2011-10-19 02:40:39',NULL,NULL,0),(206,'musician','Reece Curtis','PainfulQuandary','reececrts@yahoo.com','e929c0f18990ee8b8b044cba7423f66c','Painful Quandary is a emerging death metal band from Panama City, Florida. With all members being around the age of 17, and 18, this band will have time to grow and expand, and are still maturing as musicians. Taking influence from bands such as; Death, Gorefest, Morbid Angel, Suffocation, Morbid Saint, Napalm Death, Carcass, Vital Remains, Warbringer, Gutted, and Viral Load, Painful Quandary delivers a lethal dosage of old school style death metal that will draw in new fans of the genre and grab veterans.',NULL,NULL,NULL,'Painful Quandary is a emerging death metal band from Panama City, Florida. With all members being around the age of 17, and 18, this band will have time to grow and expand, and are still maturing as musicians. Taking influence from bands such as; Death, Gor