ic Black Metal. Hailing from the extreme North of Italy, its members Carnifex, Adventor and Ghoul gave birth to the very first release in 1999.\r\n\r\nThe demo &quot;999&quot;, which was characterized by cutting riffs, icy electronic drums and strong echo effected vocals, was well received from both the press and the audience.\r\nLater on, in 2001, Avernus is released by Maggot Records. Thanks also to the collaboration with Summum Algor, the Nefarium drummer, &quot;Avernus&quot; represents a further evolution of the band.\r\n\r\nDue to the particularly fast drumming, the musical style tends towards bands such as Marduk, Dark funeral and Setherial. After the release of Avernus, Ghoul leaves the band, Carnifex takes care of vocals while Adventor begins the composition of the songs for the new album called &quot;Praesidium&quot;.\r\n\r\nIn 2004, a deal for the album was signed between Nefarium and Downfall Records. The Swedish label publishes &quot;Praesidium&quot; which holds the same raw mood of the previous work but with a more powerful and cold sound. The press reactions for Praesidium are good and the album gains more and more positive reviews appearing on several specialized magazines. This tolls the moment in which the band emerges from the shadows and becomes a recognized force.\r\n\r\nThe Swedish-oriented style moves &quot;Praesidium&quot; up towards Northern Europe and the band earns the esteem by great musicians such as Chaq Mol (Dark Funeral) and Infaustus (Setherial). In September 2007 Nefarium signed to Agonia Records for future releases and It is with the swedish musicians and with Negatium Corporis, who now is the band&#039;s bass guitarist, that Nefarium finds the perfect frame to conceive their next assault. \r\n\r\nNefarium moved to Sweden and entered Hitfire Studio in summer 2007 to produce with Erik Lidbom their second full-length &quot;Haeretichristus&quot; . The album came out in january 2008 in USA and Europe, and has received great reviews, &quot;Haeretichristus&quot; is an overwhelming work that blends a strong black metal attitude with deeply developed technical and stylistic inserts.\r\n\r\nShortly after recording the album the drummer &quot;Summum Algor&quot; decided to quit the band because it proved impossible to combine full dedication to the band with his other daily life activities and some time later he was replaced by the french drummer &quot;Infamis&quot;. Also a new bass player &quot;Vexator&quot; was found shortly after recording Haeretichristus album.\r\n\r\nSince the beginning of 2008 Nefarium concentrated on playing live with more intensity and spent the rest of year playing gigs in Europe while working on new material, but it was decided that Infamis would no longer be a part of the band because he simply did not put as much time in the band as is required. and the band was solidified by Garghuf on drums in june 2008.\r\n\r\nGarghuf is the official drummer of Nefarium, his murderous blast bits work is known from his session performances with Gorgoroth(Nor). With the last mentioned band he has played and will play live shows.\r\n\r\nAt the end of the year Nefarium play as support band on European Impiety and Glorior Belli tour. The band will be again on studio to record next album in january 2009. \r\n\r\nNefarium New Album Ad Discipulum out the 7th May 2010 on Agonia Records.',NULL,NULL,NULL,'Nefarium was formed in the second half of the 90&#039;s and since the beginning the band had as purpose playing fast, violent and satanic Black Metal. Hailing from the extreme North of Italy, its members Carnifex, Adventor and Ghoul gave birth to the very first release in 1999.','Italy','1986-08-08','Nefarium, Black Metal, Italy','http://twitter.com/nefariumband','http://www.facebook.com/nefariumofficial1','','','',0,0,1,0,1,'0000-00-00 00:00:00','2011-11-28 07:49:40',NULL,NULL,0),(291,'musician','Brian Werner','ShadowSociety','Infernaeon@hotmail.com','08c15f462717062d05794d8357ba96ac','Shadow Society was formed in 2011 by Asgrim (Immanifest, Yetit)and Rob Thoth (Chronzon) with a very simple idea: No Drama, No Filler Riffs and No Compromise. In essence, Shadow Society was forged to make music that they wanted to hear. These ideals together with the strength of the music drew in other like-minded heavyweights in extreme music, who wanted to shape these shared ideals and music into something uniquely their own.\r\nFirst to align with the band were Roberto &Atilde;&cent;&iuml;&iquest;&frac12;&iuml;&iquest;&frac12;Kadath&Atilde;&cent;&iuml;&iquest;&frac12;&iuml;&iquest;&frac12; Celentano and Kevin Quirion (Deicide, Order of Ennead) . As long-time friends and gifted musicians, both were natural additions to the growing vision for the band&Atilde;&cent;&iuml;&iquest;&frac12;&iuml;&iquest;&frac12;s music. In addition it was a reunion of sorts, as Asgrim has worked with both of them in past projects.  The rhythm section was the final element necessary for the band to realize their vision.  After a lengthy search, the infamous Brian Werner (Monstrosity, Infernaeon) and the extremely talented Adam Sagan (Infernaeon, Into Eternity) completed the alignment. Both bring a wealth of talent and experience to SHADOW SOCIETY.\r\nTheir sound is distinct and direct.  Brutality, ambience, harmony, dissonance and darkness collide in perfect chaos as the unique talents of each individual serve the eclectic collective.\r\n\r\n \r\nThe band is preparing to enter Sound Source Recordings to track their debut EP with Kelly Nunn (MAYLENE',NULL,NULL,NULL,'.','United States','1980-05-15','Musician, manager, booking, defilement blasphemy','','http://www.facebook.com/ShadowSociety','avatar_1322423604.jpg','','',1,1,1,0,1,'0000-00-00 00:00:00','2011-12-01 08:14:43',NULL,NULL,0),(292,'listener','JTCorpse','JTCorpse','jtcorpse@yahoo.com','61bb86d1c66b79ab2d8a8272e399f4e4','Big fan of death and doom metal.',NULL,NULL,NULL,'','United States','1972-07-20','','twitter.com/JTCorpse','','','','',1,0,1