ac12;\r\nIn 2009 the band quickly focused on writing material for their self-recorded album &quot;Light the World Up.&acirc;&iuml;&iquest;&frac12;&iuml;&iquest;&frac12; Everything they have learned, mastered, and musically created was put together on this recording. &quot;Light the World Up&acirc;&iuml;&iquest;&frac12;&iuml;&iquest;&frac12; was released in the summer of 2010.\r\nTalent, dedication and desire have this band creating a buzz. FTTS have played throughout Chicago, including The Elbo Room, Lakeshore Theater, Clearwater Theater, Penny Road Pub, Shark City, and numerous local bars, clubs and venues around the city. The band caught the attention of Chicago&acirc;&iuml;&iquest;&frac12;&iuml;&iquest;&frac12;s Rock Magazine editor Mario Salazar.\r\n&acirc;&iuml;&iquest;&frac12;&iuml;&iquest;&frac12;FTTS is a young group of rockers with fire in their eyes. They are a heavy rock band with somewhat of an alternative twist to their sound.&acirc;&iuml;&iquest;&frac12;&iuml;&iquest;&frac12; &acirc;&iuml;&iquest;&frac12;&iuml;&iquest;&frac12; Mario Salazar, www.ChicagosRock.com\r\nIn late 2011 the band released a new single titled &quot;Down Into Hell.&quot; &quot;Down Into Hell&quot; features a new member of Fist, drummer JD. &quot;Down Into Hell&quot; was recorded at Mercenary Digital Studio in Zion, IL with mixer and producer Scott Creekmore (Dirge Within, Thyateria, I Killed Everyone).',NULL,NULL,NULL,'Fist to the Sky is a 4 piece Chicago based metal band. They pride themselves on their ability to fuse great melodies into their heavy sound. The young quartet formed in the fall of 2008. This is not just your ordinary metal band, the lineup is unusual to most. Lead vocals are fronted by the bass player, with the lead guitarist and drummer handling back-up vocals, breaking them away from other acts in the scene.','United States','2005-04-04','Fist,To,The,Sky,Metal,Epic,Chicago,Avenged,Sevenfold,Death,Punch,Bullet,','http://twitter.com/fisttothesky','http://www.facebo