/*Table structure for table `user_songs` */

DROP TABLE IF EXISTS `user_songs`;

CREATE TABLE `user_songs` (
  `id` int(111) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `song_name` varchar(500) NOT NULL,
  `song_credit` varchar(500) NOT NULL,
  `file_path` varchar(500) NOT NULL,
  `file_type` int(1) NOT NULL DEFAULT '0' COMMENT '0 for mp3, 1 for Zip file',
  `reject_reason` varchar(500) NOT NULL,
  `status` int(1) NOT NULL,
  `create_date` datetime NOT NULL,
  `modify_date` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

